import React from 'react';
import './HeaderSub.scss';

function HeaderSub() {
  return (
    <header>
      <nav>
        <div>
          <img src="./taeyoung/images/header/instagram-brands.svg" />
          <span />
        </div>
        <form>
          <input />
        </form>
        <div>
          <img />
          <img />
          <img />
        </div>
      </nav>
    </header>
  );
}

export default HeaderSub;
